import Grid from '../components/grid/gridLayout';

const DUMMY_DATA = [
    {
        id: 'm1',
        title: 'himalya',
        imageURL: 'https://cdn.britannica.com/67/19367-050-885866B4/Valley-Taurus-Mountains-Turkey.jpg',
        description:
          'lorem dipsum',
        category: 'nature'  
      },
      {
        id: 'm2',
        title: 'himalya 2',
        imageURL: 'https://cdn.britannica.com/67/19367-050-885866B4/Valley-Taurus-Mountains-Turkey.jpg',
        description:
          'lorem dipsum',
          category: 'nature'  
      },  
]

function HomePage(){
    return (
        <section>
          <h1>All Photos</h1>
          <Grid items={DUMMY_DATA} />
        </section>
      );
}

export default HomePage
